const createSbakeNode = (x, y, direction = "left") => {
  const cord = { x, y };
  const dir = direction;
  return { cord, dir };
};

export class Snake {
  constructor(x, y) {
    this.value = createSbakeNode(x, y);
  }
  
  grow() {}
}
